import{_ as a,o as r,c as i,z as e,a as t}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 19.2-217.1 Central file of aggravated murder indictments.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-217.1.md","filePath":"vacode/19.2-217.1.md"}'),n={name:"vacode/19.2-217.1.md"},o=e("h1",{id:"§-19-2-217-1-central-file-of-aggravated-murder-indictments",tabindex:"-1"},[t("§ 19.2-217.1 Central file of aggravated murder indictments. "),e("a",{class:"header-anchor",href:"#§-19-2-217-1-central-file-of-aggravated-murder-indictments","aria-label":'Permalink to "§ 19.2-217.1 Central file of aggravated murder indictments."'},"​")],-1),c=e("p",null,"Upon the return by a grand jury of an indictment for aggravated murder and the arrest of the defendant, the clerk of the circuit court in which such indictment is returned shall forthwith file a certified copy of the indictment with the clerk of the Supreme Court of Virginia. All such indictments shall be maintained in a single place by the clerk of the Supreme Court, and shall be available to members of the public upon request. Failure to comply with the provisions of this section shall not be (i) a basis upon which an indictment may be quashed or deemed invalid; (ii) deemed error upon which a conviction may be reversed or a sentence vacated; or (iii) a basis upon which a court may prevent or delay execution of a sentence.",-1),s=e("p",null,[t("1993, c. 319; 2021, Sp. Sess. I, cc. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0344",target:"_blank",rel:"noreferrer"},"344"),t(", "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0345",target:"_blank",rel:"noreferrer"},"345"),t(".")],-1),d=[o,c,s];function l(h,f,m,u,p,g){return r(),i("div",null,d)}const b=a(n,[["render",l]]);export{v as __pageData,b as default};
